import React, { Component } from "react";

export class test extends Component {
  render() {
    const images = [
      "http://placehold.it/100x100/76BD22",
      "http://placehold.it/100x100/76BD23"
    ];

    <ul className="product-gallery-thumbs__list">
      {images.map(function(imageSrc) {
        return (
          <li key={imgSrc}>
            <img src={imgSrc} />
          </li>
        );
      })}
    </ul>;
  }
}

export default test;
